/* @flow */

import createText from './createText';

export const Title1 = createText({
  fontSize: 28,
  leading: 34,
  tracking: 13,
  fontWeight: '200',
});
export const Title2 = createText({
  fontSize: 22,
  leading: 28,
  tracking: 16,
  fontWeight: '400',
});
export const Title3 = createText({
  fontSize: 20,
  leading: 24,
  tracking: 19,
  fontWeight: '400',
});
export const Headline = createText({
  fontSize: 17,
  leading: 22,
  tracking: -24,
  fontWeight: '600',
});
export const Body = createText({
  fontSize: 17,
  leading: 22,
  tracking: -24,
  fontWeight: '400',
});
export const Callout = createText({
  fontSize: 16,
  leading: 21,
  tracking: -20,
  fontWeight: '400',
});
export const Subhead = createText({
  fontSize: 15,
  leading: 20,
  tracking: -16,
  fontWeight: '400',
});
export const Footnote = createText({
  fontSize: 13,
  leading: 18,
  tracking: -6,
  fontWeight: '400',
});
export const Caption1 = createText({
  fontSize: 12,
  leading: 16,
  tracking: 0,
  fontWeight: '400',
});
export const Caption2 = createText({
  fontSize: 11,
  leading: 13,
  tracking: 6,
  fontWeight: '400',
});
